import React from "react";
enum DiscountType {

    PERCENTAGE = "PERCENTAGE",
    FLAT = "FLAT",
  }

interface Seller {
    id: string;
    name: string;
    ifFlipkartAssured: boolean;
  }

interface Discount {
    type: DiscountType;
    value: number;
  }

interface Product {
    id: string;
    name: string;
    description: string;
    seller: Seller;
    amount: number;
    discount: Discount;
    noOfStocksAvailable: number;
  }


const Products = ({id,name}:Product) =>{
    return(
     <div>
        <h1>{name}</h1>
        <h1>{id}</h1>
     </div>
    )

}
export default Products;
